  render() {
    return (
      <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <Text>Info Screen</Text>


        <Text>Política de compra</Text>
        <Text>Terminos y condiciones de despachos El descuevee</Text>
        <Text>Uso de la información en convenios con el descuevee</Text>

      </View>



    )
  }
}
